INSERT INTO `question_paper` VALUES (1,'A','Template Class','Abstract class','Efficient Code','Final Class','Which of the following class is known as the generic class?.','MCQ',164),(2,'B','\r\nmisfortunes','changes','suprises','sorrows','In each of the sentences given below a word is printed in bold. Below it four choices are given. Pick up the one which is most nearly the same in meaning as the word printer in bold/italic and can replaces it without altering the meaning of the sentence.\r\nThe great artist life was full of  \"vicissitudes\".','MCQ',164),(3,'A','holding the animals in captivity for our joy','going out of the house on a holiday','setting the animals free into forest','feeding the animals while others are watching','In each question, an incomplete statement (Stem) followed by fillers is given. Pick out the best one which can complete incomplete stem correctly and meaningfully.\r\nShe never visits any zoo because she is strong opponent of the idea of ........','MCQ',164),(4,'C','Member functions can be used for modifying the data type of data members','The modification of the code can be additional overhead','The data type of the data member can be easily modified without modifying any other code','The data type of data member cannot be modified.','Which among the following concept is correct if a user using the concept of encapsulation in a code?','MCQ',164),(5,'D','\r\nhotly debated','\r\nstuck up','ignored','\r\ngoing on slowly','Some proverbs/idioms are given below together with their meanings. Choose the correct meaning of proverb/idiom, If there is no correct meaning given, E (i.e.) \'None of these\' will be the answer.\r\nThis matter has been hanging fire for the last many months and must therefore be decided one way or the other.','MCQ',164),(6,'D','animal','zoo','prisoner','encloser','Each question has an underlined word followed by four answer choices. You will choose the word that is a necessary part of the underlined word.\r\n\"Cage\"','MCQ',164),(7,'D','Only assumption I is implicit','Both I and II are implicit','\r\nEither I or II is implicit','Only assumption II is implicit','In each question below is given a statement followed by two assumptions numbered I and II. You have to consider the statement and the following assumptions and decide which of the assumptions is implicit in the statement.\r\n\r\nGive answer\r\n\r\n(A) If only assumption I is implicit\r\n(B) If only assumption II is implicit\r\n(C) If either I or II is implicit\r\n(D) If neither I nor II is implicit\r\n(E) If both I and II are implicit.\r\n\r\n\r\nStatement: \"Please put more people on the job to make up for the delay.\"\r\n\r\nAssumptions:\r\n\r\nI. Delay is inevitable in most jobs.\r\nII. Output will increase with more number of people on the job.','MCQ',164),(8,'C','33 37','36 40','34 38','34 36 ','Look carefully for the pattern, and then choose which pair of numbers comes next.\r\n6 10 14 18 22 26 30','MCQ',164),(9,'B','G','J','I','H','Each of these questions are based on the information given below :\r\n8 persons E, F, G, H, I, J, K and L are seated around a square table - two on each side.\r\nThere are 3 ladies who are not seated next to each other.\r\nJ is between L and F.\r\nG is between I and F.\r\nH, a lady member is second to the left of J.\r\nF, a male member is seated opposite to E, a lady member.\r\nThere is a lady member between F and I.\r\nWho among the following is to the immediate left of F ?','MCQ',164),(10,'B','375','400','600','800','A alone can do a piece of work in 6 days and B alone in 8 days. A and B undertook to do it for Rs. 3200. With the help of C, they completed the work in 3 days. How much is to be paid to C?','MCQ',164),(11,'A','Private access specifier','Public access specifier','Protected access specifier','Depend on compiler','The name of the default access specifier for the member functions or data members in the C++ programming language is_________.','MCQ',164),(12,'C','564','645','756','753','\r\nFrom a group of 7 men and 6 women, five persons are to be selected to form a committee so that at least 3 men are there on the committee. In how many ways can it be done?','MCQ',164),(13,'D','12 unit','4‚àö3','8 unit','Data inadequate','A man standing at a point P is watching the top of a tower, which makes an angle of elevation of 30¬∞ with the man\'s eye. The man walks some distance towards the tower to watch its top and the angle of the elevation becomes 60¬∞. What is the distance between the base of the tower and the point P?','MCQ',164),(14,'D','\r\n8/11\r\n','\r\n5/11\r\n','\r\n7/11\r\n','\r\n6/11\r\n','Three pipes A, B and C can fill a tank from empty to full in 30 minutes, 20 minutes, and 10 minutes respectively. When the tank is empty, all the three pipes are opened. A, B and C discharge chemical solutions P,Q and R respectively. What is the proportion of the solution R in the liquid in the tank after 3 minutes?','MCQ',164),(15,'A','An int Value','true ','false  ','None','\r\ncompareTo() returns','MCQ',164),(16,'C','\r\nTaxol has cured people from various diseases.','\r\nTaxol is poisonous when taken by healthy people.','\r\nPeople should not eat the fruit of the Pacific yew','The Pacific yew was considered worthless until taxol was discovered.','\r\nThe Pacific yew is an evergreen tree that grows in the Pacific Northwest. The Pacific yew has a fleshy, poisonous fruit. Recently, taxol, a substance found in the bark of the Pacific yew, was discovered to be a promising new anticancer drug.','MCQ',164),(17,'D','Dev','Nilesh','Ankur','Pintu','Dev, Kumar, Nilesh, Ankur and Pintu are standing facing to the North in a playground such as given below:\r\nKumar is at 40 m to the right of Ankur.\r\nDev is are 60 m in the south of Kumar.\r\nNilesh is at a distance of 25 m in the west of Ankur.\r\nPintu is at a distance of 90 m in the North of Dev.\r\nWhich one is in the North-East of the person who is to the left of Kumar?','MCQ',164),(18,'A','6400','6500','7200','7500','\r\nMr. Thomas invested an amount of Rs. 13,900 divided in two different schemes A and B at the simple interest rate of 14% p.a. and 11% p.a. respectively. If the total amount of simple interest earned in 2 years be Rs. 3508, what was the amount invested in Scheme B?','MCQ',164),(19,'A','Veil','Hat','Turban','Cap','In each of the following questions, five words have been given out of which four are alike in some manner, while the fifth one is different. Choose the word which is different from the rest.\r\nChoose the word which is different from the rest.','MCQ',164),(20,'C','*(*a+3)','&(a+3)','*(a+3)','*a+3','How is the 3rd element in an array accessed based on pointer notation?','MCQ',164),(21,'B','Null Pointer Exception','Aritmetic Exception','NumberFormat Exception','None','Which of the following exception is thrown when divided by zero statement is executed?','MCQ',164),(22,'D','Curd','Cream','water','Whiteness','What is found necessarily in milk?','MCQ',164),(23,NULL,NULL,NULL,NULL,NULL,'Write a  program to find a leap year','Programming',164),(24,NULL,NULL,NULL,NULL,NULL,'Write a program remove upper case letter to lower case from a string in Java?','Programming',164),(25,'A','\r\nWe discussed about the problem so thoroughly','\r\non the eve of the examination','\r\nthat I found it very easy to work it out','\r\nNo error','Capital Of PunjabRead each sentence to find out whether there is any grammatical error in it. The error, if any will be in one part of the sentence. The letter of that part is the answer. If there is no error, the answer is \'D\'. (Ignore the errors of punctuation, if any).\r\n(solve as per the direction given above).','MCQ',98),(26,'B','\r\nStodge','Opening','Past tense of go','End','In the following the questions choose the word which best expresses the meaning of the given word.\r\nVENT','MCQ',98),(27,'A','does','has done','did','No correction Required','Which of phrases given below each sentence should replace the phrase printed in bold type/Underlined to make the grammatically correct? If the sentence is correct as it is, mark \'E\' as the answer.\r\nThe small child does whatever his father was done.','MCQ',98),(28,'C','\r\nYou come only when you want to','\r\nYou needn\'t come until you don\'t want to','You don\'t need to come unless you want toy','No correction Required','You need not come unless you want to.','MCQ',98),(29,'D','\r\nTo fail to arouse interest','\r\nTo have no result','\r\nTo work for both sides','A private end to serve','Some proverbs/idioms are given below together with their meanings. Choose the correct meaning of proverb/idiom, If there is no correct meaning given, E (i.e.) \'None of these\' will be the answer.\r\nTo have an axe to grind.','MCQ',98),(30,'D','Treatmeant','Employd','Beterment','Efficient','Find the correctly spelt words.\r\n','MCQ',98),(31,'A','15432','45321','12543','45132','In each question below a sentence broken into five or six parts. Join these parts to make a meaningful sentence. The correct order of parts is the answer.\r\n1. I  2. immediately 3. salary\r\n4. my 5. want','MCQ',98),(32,'D','a commanding situation','an alarming journey','\r\na frightful battle.','\r\na journey into outer space','I felt the wall of the tunnel shiver. The master alarm squealed through my earphones. Almost simultaneously, Jack yelled down to me that there was a warning light on. Fleeting but spectacular sights snapped into ans out of view, the snow, the shower of debris, the moon, looming close and big, the dazzling sunshine for once unfiltered by layers of air. The last twelve hours before re-entry were particular bone-chilling. During this period, I had to go up in to command module. Even after the fiery re-entry splashing down in 81o water in south pacific, we could still see our frosty breath inside the command module.\r\n\r\nThe word \'Command Module\' used twice in the given passage indicates perhaps that it deals with','MCQ',98),(33,'B','\r\nThe moon was looming close and big.','A catastrophe was imminent.','Jack was yelling.','There was a shower of debris.','Which one of the following reasons would one consider as more as possible for the warning lights to be on?','MCQ',98),(34,'B','round','on','with','over','Pick out the most effective word(s) from the given words to fill in the blank to make the sentence meaningfully complete.\r\n\r\nFate smiles ...... those who untiringly grapple with stark realities of life.','MCQ',98),(35,'A','\r\n200','10','10240','none','Find out the wrong number in the series.\r\n40960, 10240, 2560, 640, 200, 40, 10','MCQ',98),(36,'C','\r\nRs. 9600','\r\nRs. 6500','\r\nRs. 6240','\r\nRs. 3100','\r\nIn order to obtain an income of Rs. 650 from 10% stock at Rs. 96, one must make an investment of:','MCQ',98),(37,'B','200m','173m','156m','170m','From a point P on a level ground, the angle of elevation of the top tower is 30¬∞. If the tower is 100 m high, the distance of point P from the foot of the tower is:','MCQ',98),(38,'D','9','1','49','20','Find the odd man out.\r\n1, 4, 9, 16, 20, 36, 49','MCQ',98),(39,'A','60/11 days','71/11 days','61/11 days','72/11 days','\r\nP can complete a work in 12 days working 8 hours a day. Q can complete the same work in 8 days working 10 hours a day. If both P and Q work together, working 8 hours a day, in how many days can they complete the work?','MCQ',98),(40,'C','16','18','24','20','The sum of how many terms of the series 6 + 12 + 18 + 24 + ... is 1800 ?','MCQ',98),(41,'B','South-East','West','North','East','Rahul put his timepiece on the table in such a way that at 6 P.M. hour hand points to North. In which direction the minute hand will point at 9.15 P.M. ?','MCQ',98),(42,'D','\r\nThere are three persons to the right of Paul.','\r\nRobert is not at the left end.','\r\nRobert is in between Simon and Taud.','Taud is in between Paul and Jack.','There are 8 houses in a line and in each house only one boy lives with the conditions as given below:\r\n\r\nJack is not the neighbour Siman.\r\nHarry is just next to the left of Larry.\r\nThere is at least one to the left of Larry.\r\nPaul lives in one of the two houses in the middle.\r\nMike lives in between Paul and Larry.\r\nIf at least one lives to the right of Robert and Harry is not between Taud and Larry, then which one of the following statement is not correct ?','MCQ',98),(43,'A','JDB','JRE','JVM','JDK','Which of the following is used to find and fix bugs in the program?','MCQ',98),(44,'C','\r\nIt can extend exactly one class and implement exactly one interface.','\r\nIt can extend exactly one class and can implement multiple interfaces.','\r\nIt can extend exactly one class or implement exactly one interface.','\r\nIt can implement multiple interfaces regardless of whether it also extends a class.','Which is true about an anonymous inner class?','MCQ',98),(45,'B','It can be called Zero or more times','It can be called Zero or one times','It can be called exactly once','It can be called one or more times',' \r\nWhich of the following statements are true about finalize() method?','MCQ',98),(46,'D','Always','Often','Sometimes','Never','\r\nYesterday I saw an ice cube which had already melted due to heat of a nearby furnace.','MCQ',98),(47,NULL,NULL,NULL,NULL,NULL,'Write a program to check if a vowel is present in a string?','Programming',98),(48,NULL,NULL,NULL,NULL,NULL,'Write a  program to print a Fibonacci sequence using recursion.','Programming',98),(49,'A','\r\nI will have helped him.','\r\nIf I had known','\r\nthis yesterday','\r\nNo error','Read each sentence to find out whether there is any grammatical error in it. The error, if any will be in one part of the sentence. The letter of that part is the answer. If there is no error, the answer is \'D\'. (Ignore the errors of punctuation, if any).\r\n(solve as per the direction given above).','MCQ',963),(50,'B','\r\n\r\nRidiculous','\r\n\r\nDignified','Common','Petty','In the following the questions choose the word which best expresses the meaning of the given word.\r\n\r\n\"AUGUST\"','MCQ',963),(51,'A','\r\npeople came to know that he was annoyed','\r\nwe could detect that he was very happy','\r\nhe could succeed in doing it easily','he failed to give us an impression of his agony','In each question, an incomplete statement (Stem) followed by fillers is given. Pick out the best one which can complete incomplete stem correctly and meaningfully.\r\nDespite his best efforts to conceal his anger ......','MCQ',963),(52,'C','\r\nYou come only when you want to','\r\nYou needn\'t come until you don\'t want to','You don\'t need to come unless you want toy','No correction Required','Which of phrases given below each sentence should replace the phrase printed in bold type/Underlined to make the grammatically correct? If the sentence is correct as it is, mark \'E\' as the answer.\r\n\"You need not come unless you want to\".','MCQ',963),(53,'D','To meet with disaster','\r\nTo have no result','To deal with a person who is more than one\'s match','\r\nTo catch a dangerous person','Some proverbs/idioms are given below together with their meanings. Choose the correct meaning of proverb/idiom, If there is no correct meaning given, E (i.e.) \'None of these\' will be the answer.\r\nTo catch a tartar','MCQ',963),(54,'D','oasis','flat','Cactus','arid','Each question has an underlined word followed by four answer choices. You will choose the word that is a necessary part of the underlined word.\r\ndesert','MCQ',963),(55,'D','Only assumption I is implicit','Only assumption II is implicit','Neither I nor II is implicit','Both I and II are implicit','In each question below is given a statement followed by two assumptions numbered I and II. You have to consider the statement and the following assumptions and decide which of the assumptions is implicit in the statement.\r\n\r\nGive answer\r\n\r\n(A) If only assumption I is implicit\r\n(B) If only assumption II is implicit\r\n(C) If either I or II is implicit\r\n(D) If neither I nor II is implicit\r\n(E) If both I and II are implicit.\r\n\r\n\r\n\r\nStatement: \"You are hereby appointed as a programmer with a probation period of one year and your performance will be reviewed at the end of the period for confirmation.\" - A line in an appointment letter.\r\n\r\nAssumptions:\r\n\r\nThe performance of an individual generally is not known at the time of appointment offer.\r\nGenerally an individual tries to prove his worth in the probation period.','MCQ',963),(56,'C','72','144','360','720','In how many ways can the letters of the word \'LEADER\' be arranged?','MCQ',963),(57,'B','Between B and D','Between B and C','Between E and D','Between E and C','A, B, C, D and E are sitting on a bench. A is sitting next to B, C is sitting next to D, D is not sitting with E who is on the left end of the bench. C is on the second position from the right. A is to the right of B and E. A and C are sitting together. In which position A is sitting ?','MCQ',963),(58,'B','round','on','with','over','Pick out the most effective word(s) from the given words to fill in the blank to make the sentence meaningfully complete.\r\n\r\nFate smiles ...... those who untiringly grapple with stark realities of life.','MCQ',963),(59,'A','\r\n200','10','10240','none','Find out the wrong number in the series.\r\n40960, 10240, 2560, 640, 200, 40, 10','MCQ',963),(60,'C','Only conclusion I follows','Only conclusion II follows','Both I and II follow','Neither I nor II follows','In each question below is given a statement followed by two conclusions numbered I and II. You have to assume everything in the statement to be true, then consider the two conclusions together and decide which of them logically follows beyond a reasonable doubt from the information given in the statement.\r\n\r\nGive answer:\r\n\r\n(A) If only conclusion I follows\r\n(B) If only conclusion II follows\r\n(C) If either I or II follows\r\n(D) If neither I nor II follows and\r\n(E) If both I and II follow.\r\n\r\n\r\nStatements: Government has spoiled many top ranking financial institutions by appointing bureaucrats as Directors of these institutions.\r\n\r\nConclusions:\r\n\r\nGovernment should appoint Directors of the financial institutes taking into consideration the expertise of the person in the area of finance.\r\nThe Director of the financial institute should have expertise commensurate with the financial work carried out by the institute.','MCQ',963),(61,'B','200m','173m','156m','170m','From a point P on a level ground, the angle of elevation of the top tower is 30¬∞. If the tower is 100 m high, the distance of point P from the foot of the tower is:','MCQ',963),(62,'D','9','1','49','20','Find the odd man out.\r\n1, 4, 9, 16, 20, 36, 49','MCQ',963),(63,'A','60/11 days','71/11 days','61/11 days','72/11 days','\r\nP can complete a work in 12 days working 8 hours a day. Q can complete the same work in 8 days working 10 hours a day. If both P and Q work together, working 8 hours a day, in how many days can they complete the work?','MCQ',963),(64,'C','language:deaf','tongue:sound','speech:dumb','voice:vibration','Each question consist of two words which have a certain relationship to each other followed by four pairs of related words, Select the pair which has the same relationship.\r\nLIGHT:BLIND','MCQ',963),(65,'B','South-East','West','North','East','Rahul put his timepiece on the table in such a way that at 6 P.M. hour hand points to North. In which direction the minute hand will point at 9.15 P.M. ?','MCQ',963),(66,'D','\r\nThere are three persons to the right of Paul.','\r\nRobert is not at the left end.','\r\nRobert is in between Simon and Taud.','Taud is in between Paul and Jack.','There are 8 houses in a line and in each house only one boy lives with the conditions as given below:\r\n\r\nJack is not the neighbour Siman.\r\nHarry is just next to the left of Larry.\r\nThere is at least one to the left of Larry.\r\nPaul lives in one of the two house